import React from "react";

function FAQ() {
  return (
    <div>
      <h2>Frequently Asked Questions</h2>
      <ul>
        <li><strong>How do I book a ticket?</strong> <br />Select a movie, click "Book Now", fill the form, and submit.</li>
        <li><strong>Can I cancel my booking?</strong> <br />Currently, bookings are non-refundable.</li>
        <li><strong>How do I contact support?</strong> <br />Use the contact form on the Contact page.</li>
      </ul>
    </div>
  );
}

export default FAQ;
